import React from 'react'
import { Button } from 'semantic-ui-react'


const NavBar = (props) => {
  const {history} = props
  return (
    <div>
      <Button color='red' onClick={() => history.push()}>
          Search
        </Button>
        {this.props.currentUser && (
          <Button color='red' onClick={() => {history.push('/profile')}}>
            Profile
          </Button>
        )}
        {this.state.currentUser && (
          <Button color='red' onClick={this.logout}>
            Logout
          </Button>
        )}
    </div>
  )
}
export default NavBar
